import React from 'react';

const Notfound = () => {
  return(
      <div>
          <div style={{display:"flex",color:"red",justifyContent:"center",alignItems:"center",margin:"10%"}}>
                <h1 className='display-6' style={{color:"red"}}>Page Not Found</h1>
            </div>
      </div>
  );
};

export default Notfound;
